      Doctor_infor.hasOne(models.Markdown, {
        foreignKey: "doctorId",
        as: "infoDataMarkdown",
      });
      Doctor_infor.belongsTo(models.Allcode, {
        foreignKey: "priceId",
        targetKey: "keyMap",
