sourcesContent:
require("dotenv").config();
import nodemailer from "nodemailer";

const sendSimpleEmail = async (dataSend) => {
  const transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587,
    secure: false, // true for port 465, false for other ports
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  const info = await transporter.sendMail({
    from: 'Kaiser " <minh.hacker89@gmail.com>', // sender address
    to: dataSend.receiverEmail, // list of receivers
    subject: "Hello ", // Subject line
    text: "Hello world?", // plain text body
    html: getBodyHTMLEmail(dataSend),
  });
};

const getBodyHTMLEmail = (dataSend) => {
  let result = "";
  if (dataSend.language === "en") {
    result = `
      <h3>Dear ${dataSend.patientName}!</h3>
      <p>You received this email because you booked an online medical appointment on BookingCare</p>
      <p>Appointment information:</p>
      <div><b>Time: ${dataSend.time}</b></div>
      <div><b>Doctor: ${dataSend.doctorName}</b></div>

      <p>If the above information is true, please click the link below to confirm and complete the appointment procedure.</p>
      <div><a href=${dataSend.redirectLink} target="_blank">Click here</a></div>

      <div>Thanks so much!</div>
    `;
  }
  if (dataSend.language === "vi") {
    result = `
      <h3>Xin cho ${dataSend.patientName}!</h3>
      <p>Bn nhn c email ny v  t lch khm bnh online trn BookingCare</p>
      <p>Thng tin t lch khm bnh:</p>
      <div><b>Thi gian: ${dataSend.time}</b></div>
      <div><b>Bc s: ${dataSend.doctorName}</b></div>

      <p>Nu cc thng tin trn l ng l s tht, vui lng click ng link bn di  xc nhn v hon tt th tc t lch khm bnh.</p>
      <div><a href=${dataSend.redirectLink} target="_blank">Click here</a></div>

      <div>Xin chn thnh cm n!</div>
    `;
  }
  return result;
};

const emailResetPassword = async (dataSend) => {
  const transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587,
    secure: false, // true for port 465, false for other ports
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  const info = await transporter.sendMail({
    from: 'Kaiser " <minh.hacker89@gmail.com>', // sender address
    to: dataSend.email, // list of receivers
    subject: "Hello ", // Subject line
    text: "Email Reset Password", // plain text body
    html: getBodyResetPassowrd(dataSend),
  });
};

const getBodyResetPassowrd = (dataSend) => {
  let result = "";
  if (dataSend.language === "en") {
    result = `
      <h3>Hello user with email ${dataSend.email}!</h3>
      <p>You received this email because you submitted a password reset request for your account</p>
      <p>Account information:</p>
      <div><b>User name: ${dataSend.fullName}</b></div>
      <div><b>Email: ${dataSend.email}</b></div>
      <div><b>Address: ${dataSend.address}</b></div>
      <div><b>Phone number: ${dataSend.phoneNumber}</b></div>

      <p>If the above information is true, please click the link below to confirm and complete the password reset procedure.</p>
      <div><a href=${dataSend.redirectLink} target="_blank">Click here</a></div>

       <div>Xin chn thnh cm n!</div>
    `;
  }
  if (dataSend.language === "vi") {
    result = `
      <h3>Xin cho ngi dng vi email ${dataSend.email}!</h3>
      <p>Bn nhn c email ny v  gi yu cu t li mt khu cho ti khon</p>
      <p>Thng tin ti khon:</p>
      <div><b>Tn ngi dng: ${dataSend.fullName}</b></div>
      <div><b>Email: ${dataSend.email}</b></div>
      <div><b>a ch: ${dataSend.address}</b></div>
      <div><b>S in thoi: ${dataSend.phoneNumber}</b></div>

      <p>Nu cc thng tin trn l ng l s tht, vui lng click ng link bn di  xc nhn v hon tt th tc t li mt khu.</p>
      <div><a href=${dataSend.redirectLink} target="_blank">Click here</a></div>

      <div>Xin chn thnh cm n!</div>
    `;
  }
  return result;
};

export { sendSimpleEmail, emailResetPassword };

